    false,nt"url": null,nt"notes": "A ground survey of Dall sheep age and sex
    composition in the Hulahula River drainage, Arctic National Wildlife Range, was
    undertaken in July1979. Summer composition data from ground surveys, when coupled
    with a total population estimate and summer distribution patterns derived from aerial
    surveys, are basic prerequisites to the scientific management of the Hulahula sheep
    population. Only after obtaining this information can we properly evaluate and adjust
    hunter harvest rates and distribution to ensure that harvest does not exceed sustainable
